import { Outlet, Link } from "react-router-dom/dist/index.mts";


const Layout = () => {
    return (
        <>
        <nav>
            <ul>
                <li>
                    <Link to ="/">QuestionsPage</Link>
                </li>
                <li>
                    <Link to ="/ask">AskPage</Link>
                </li>
            </ul>

        </nav>
        <Outlet />

        </>
    )
};


export default Layout;
